import React, { useState } from "react";

const AboutCV = ({ aboutApii }) => {
  return (
    <>
      {aboutApii.map((e) => {
        const { id, name, age, gender, lang, work, freelance } = e;
        return (
          <>
            <div className="box">
              <p>
                <span> age : </span> {age}
              </p>
              <p>
                <span> gender : </span> {gender}
              </p>
              <p>
                <span> language : </span> bangla, english
              </p>
              <p>
                <span> work : </span> full stack react developer
              </p>
            </div>
            <div className="box">
              <p>
                <span> freelance : </span> available
              </p>
              <p>
                <span> phone : </span> +8801722166051
              </p>
              <p>
                <span> email : </span>
                <a href="mailto:smsiam696@gmail.com"> smsiam696@gmail.com</a>
              </p>
              <p>
                <span> country : </span> bangladesh
              </p>
            </div>
          </>
        );
      })}
    </>
  );
};

export default AboutCV;
